object.script:
alpha1 = 20 alpha2 = 225 alpha3 = 50
tilt = 0 rollAngle = 0 vertCheck = true lineDist = property.getNumber('Degrees per Line') pixPerDegree = property.getNumber('Pixels per Degree') maxLineWidth = property.getNumber('Maximum Line Length as Screen Percent') lineDivideFactor = (property.getNumber('Minimum Line Length as Percent of Max')+1)*90 if property.getBool('Vertical Flip') then yMod = -1 else yMod = 1 end
function onTick() tilt = input.getNumber(7)*360 -- Tilt (Forward tilt sensor) supplied through composite 7 maxAngle = 90-math.abs(tilt) rollAngle = (input.getNumber(8)*-360)/maxAngle*90 -- Roll (Left tilt sensor) supplied through composite 8 vertCheck = input.getNumber(9)>=0 if not vertCheck then -- Vertical check (Up tilt sensor) supplied through composite 9 tilt = tilt*-1 rollAngle = rollAngle*-1 end isP = input.getBool(1) IsP = input.getBool(2) VTOL = input.getBool(3) KCA = input.getBool(4) KA = input.getBool(5) AP = input.getBool(6) AH = input.getBool(7)
if isP == nil then return false end if isP and not t then toggle = not toggle end t = isP
if IsP == nil then return false end if IsP and not T then Toggle = not Toggle end T = IsP
if toggle then alpha1 = 10 alpha2 = 25 alpha3 = 255 elseif not toggle then alpha1 = 20 alpha2 = 225 alpha3 = 50 end end
function calcXY(x,y,bearing,distance) bearing = math.rad(bearing + 90) y = y+math.cos(bearing) * -distance x = x+math.sin(bearing) * distance return x,y end
function onDraw() if Toggle then else screen.setColor(255,255,0,alpha1) screen.drawRect(0,1,31,30) screen.drawLine(0,9,31,9) screen.drawLine(0,16,31,16) screen.drawLine(0,23,31,23) screen.drawLine(15,23,15,31)
if VTOL then screen.setColor(0, 255, 0,alpha2) else screen.setColor(255, 0, 0,alpha2) end screen.drawText(6, 3, "VTOL")
if KCA then screen.setColor(0, 255, 0,alpha2) else screen.setColor(255, 0, 0,alpha2) end screen.drawText(2, 11, "KC.ALT")
if KA then screen.setColor(0, 255, 0,alpha2) else screen.setColor(255, 0, 0,alpha2) end screen.drawText(4, 18, "K.ALT")
if AP then screen.setColor(0, 255, 0,alpha2) else screen.setColor(255, 0, 0,alpha2) end screen.drawText(4, 25, "AP")
if AH then screen.setColor(0, 255, 0,alpha2) else screen.setColor(255, 0, 0,alpha2) end screen.drawText(19, 25, "AH")
w = screen.getWidth() h = screen.getHeight()
if vertCheck then screen.setColor(100, 50, 0,alpha3) else screen.setColor(50,50,255,alpha3) end for lineAngle = -90, 90, lineDist do if lineAngle>0 and vertCheck then screen.setColor(50,50,255,alpha3) elseif lineAngle>0 and not vertCheck then screen.setColor(100,50,0,alpha3) end lineLen = (maxLineWidth*w)*(1-math.abs(lineAngle)/lineDivideFactor) currentY = (tilt-lineAngle)*pixPerDegree*yMod mX, mY = calcXY(w/2,h/2,rollAngle+90,currentY) lX, lY = calcXY(mX,mY,rollAngle,lineLen/2) rX, rY = calcXY(mX,mY,rollAngle+180,lineLen/2) screen.drawLine(lX,lY,rX,rY) end centerY = h/2+tilt*pixPerDegree*yMod screen.setColor(125,125,125,alpha3) mX, mY = calcXY(w/2,h/2,rollAngle+90,tilt*pixPerDegree*yMod) lX, lY = calcXY(mX,mY,rollAngle,100) rX, rY = calcXY(mX,mY,rollAngle+180,100) screen.drawLine(lX,lY,rX,rY) screen.setColor(255,0,0,alpha3) screen.drawRectF(w/2-1,h/2,2,2) end end
